import { Card, CardHeader, List, ListItem, ListItemAvatar, Avatar, ListItemText } from "@mui/material";
import React from "react";

const birthdayList = ({people})=>{
    return(
        <List>
            {people.map((person)=>{
                const {id, name, age, image} = person;
                return(
                    <ListItem>
                        <ListItemAvatar>
                            <Avatar>
                            <img src={image} alt={name} />
                            </Avatar>
                        </ListItemAvatar>
                        <ListItemText primary={name} secondary={age + ' years'} />
                    </ListItem>
                        
                    // <article key={id} className='person'>
                    //     <img src={image} alt={name} />
                    //     <div>
                    //     <h4>{name}</h4>
                    //     <p>{age} years</p>
                    //     </div>
                    // </article>
                );
            })}
        </List>
    );
};

export default birthdayList;
